import React, { Component } from "react";
import { connect } from 'react-redux';

class ProjectsCard extends Component {



    render() {
        return (
            <div>
                {this.props.reduxStore.projectsReducer.map((project, projectsid) => {
                    return 
                    (<tr>key={projectsid}>
                    <td></td>
                        <td>{project.name}</td>
                        <td>{description}</td>
                        <td>{description}</td>
                        <td>{thumbnail}</td>
                        <td>{website}</td>
                        <td>{date_completed}</td>
                        <td>{tag_id}</td>
                    </tr>
                    )
                })}


                {JSON.stringify(this.props.reduxStore.projectsReducer.name)}
                <h1>[{this.props.reduxStore.projectsReducer}]</h1>

            </div>
        );
    }
}

const mapReduxStoreToProps = (reduxStore) => ({
    reduxStore
});
export default connect(mapReduxStoreToProps)(ProjectsCard);
